@Jayda.Hawkinsss and @JaylinnHawkins' wedding ceremony was set with both the ocean and the mountains as its backdrop. “The circular ceremony setup really allowed for you to take in the full 360 view,” explains Jayda. Florals lined the aisle and central platform to feel as if they were an organic part of the environment.

The couple had a personal ceremony with original vows. They were also married by their pastor, who had known them their entire relationship. “Having Kevin marry us was important because he has literally seen us through every stage of our relationship,” the newlyweds shares. “He has helped us through the good and the bad, as we’ve navigated all the transitions of the NFL and life.” Head to the link in bio to see more photos of the couple's Hawaiian nuptials. 
Photos: @sav.and.cam
